import React from 'react';
import { motion } from 'framer-motion';

const Certificates = () => {
  const fadeIn = {
    initial: { opacity: 0, y: 20 },
    animate: { opacity: 1, y: 0 },
    transition: { duration: 0.6, ease: [0.22, 1, 0.36, 1] }
  };

  const certificates = [
    {
      name: "Deep Learning Specialization",
      issuer: "DeepLearning.AI",
      date: "December 2023",
      description: "Comprehensive training in neural networks, optimization algorithms, and deep learning applications."
    },
    {
      name: "AWS Machine Learning Specialty",
      issuer: "Amazon Web Services",
      date: "October 2023",
      description: "Advanced certification in building and deploying ML solutions on AWS cloud infrastructure."
    },
    {
      name: "TensorFlow Developer Certificate",
      issuer: "Google",
      date: "August 2023",
      description: "Professional certification in developing ML models using TensorFlow framework."
    },
    {
      name: "Data Science Professional Certificate",
      issuer: "IBM",
      date: "May 2023",
      description: "Comprehensive data science program covering statistics, ML, and data visualization."
    }
  ];

  return (
    <section id="certificates" className="section">
      <motion.div
        initial="initial"
        whileInView="animate"
        viewport={{ once: true }}
        variants={{
          animate: { transition: { staggerChildren: 0.1 } }
        }}
      >
        <motion.h2 
          variants={fadeIn}
          className="text-h2 text-text mb-8"
        >
          Certificates
        </motion.h2>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          {certificates.map((cert, index) => (
            <motion.div
              key={index}
              variants={fadeIn}
              className="bg-background-dark rounded-xl p-6"
            >
              <div className="flex justify-between items-start mb-2">
                <h3 className="text-h3 text-text">{cert.name}</h3>
                <span className="text-small text-text-light">{cert.date}</span>
              </div>
              
              <p className="text-body text-primary mb-3">{cert.issuer}</p>
              <p className="text-body text-text-light">{cert.description}</p>
            </motion.div>
          ))}
        </div>
      </motion.div>
    </section>
  );
};

export default Certificates;
